  })
  const handelChange=(e) =>{
    const {name, pass } = e.target
    setData((prevData) =>{
      return {...prevData, [name]:pass }
    })
  }
  return (
    <div className="App">
      <h1> {data}j </h1>
      <input value={data.username} name='username' onChange={handelChange}/>
      <input name='password' value={data.password}  onChange={ handelChange }/>
      <h1> {data.username}j </h1>

    </div>
  );
}

export default App;
